import React from 'react'
import './Navbar.scss';

export default function Navbar() {
    return (
        <div className="navbar">
            <div className="logo">
                <img src="./assets/logo.png" alt="logo" />
            </div>
            <ul>
                <li>Home</li>
                <li>Search</li>
                <li>Library</li>
            </ul>
        </div>
    )
}
